import React from "react";

function TestImages() {
  return (
    <div>
      <h2>Test Images</h2>
      <img src="/images/headphones.jpg" alt="Headphones" width={300} />
      <img src="/images/smartwatch.jpg" alt="Smart Watch" width={300} />
      <img src="/images/speaker.jpg" alt="Speaker" width={300} />
    </div>
  );
}

export default TestImages;
